import placeholder from "../../placeholder.png";

const FriendsList = props => {

    const username = "Mark";
    return (
        <div className="flex flex-col">
            <div id="profile"className="h-20 text-5xl flex flex-auto text-white  mb-10"> 
                <img className ="rounded-full w-16 h-auto mr-5" alt="" src ={placeholder}/> 
                {username}
            </div>
            <div id="friends" className="text-white text-xl h-auto border-solid border-b-2 border-black flex flex-col" >
                Friends
                <div className="justify-end">ADD</div>
            </div>

            <div id="chats" className="text-white text-xl h-auto border-solid border-b-2 border-black flex flex-col">Chats</div>


        </div>
    )
}



export default FriendsList;
